import React from 'react';
import { Link } from 'react-router-dom';
import { FaHeartbeat, FaDumbbell, FaWalking, FaBrain, FaClinicMedical, FaInfoCircle } from 'react-icons/fa';

import '../index.css'; // or wherever your styles are

const Dashboard = () => {
  const cards = [
    {
      title: 'Cardiac Rehab',
      description: 'For heart-related recovery exercises',
      icon: <FaHeartbeat size={28} color="#e63946" />,
      label: 'Cardiac',
      path: '/exercise'
    },
    {
      title: 'Orthopedic Rehab',
      description: 'Strength and joint mobility routines',
      icon: <FaDumbbell size={28} color="#1d3557" />,
      label: 'Orthopedic',
      path: '/exercise'
    },
    {
      title: 'Neuro Rehab',
      description: 'Neural and balance-related recovery',
      icon: <FaBrain size={28} color="#6a0572" />,
      label: 'Neuro',
      path: '/exercise'
    },
    {
      title: 'Physiotherapy',
      description: 'General physio-guided movement therapy',
      icon: <FaWalking size={28} color="#06d6a0" />,
      label: 'Physiotherapy',
      path: '/exercise'
    },
    {
      title: 'Contact Us',
      description: 'We care a lot about you ‚ù§Ô∏è',
      icon: <FaInfoCircle size={28} color="#118ab2" />,
      label: '',
      path: '/contact',
      buttonText: 'Know More'
    },
    {
      title: 'Best Rehab Center',
      description: 'Find the closest center near you üè•',
      icon: <FaClinicMedical size={28} color="#ff6b6b" />,
      label: '',
      path: '/rehab-center',
      buttonText: 'Find'
    }
  ];

  return (
    <div className="dashboard-container">
      <header className="header">
        <h1>AI-Rehab Dashboard</h1>
      </header>
      <div className="main-content">
        {cards.map((card, index) => (
          <div key={index} className="card">
            {card.icon}
            <h2>{card.title}</h2>
            {card.label && <p className="label">{card.label}</p>}
            <p>{card.description}</p>
            <Link to={card.path}>
              <button className="start-button">
                {card.buttonText || 'Start'}
              </button>
            </Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
